import Approach from "./components/Approach";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Hero from "./components/Hero";

function App() {
  return (
    <div className="container-fluid custom">
      <Header />
      <Hero />
      <Approach />
      <Footer />
    </div>
  );
}

export default App;
